import React, { useState } from "react";

function Dropdownmenu() {
  return (
    <>
      <div className="dropdown">
        <div className="menu">
          <div>1</div>
          <div>2</div>
          <div>3</div>
        </div>
      </div>
    </>
  );
}
export default Dropdownmenu;
